// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './pages/HomePage';  // Import the HomePage component
import FaceCapturePage from './pages/FaceCapturePage'; // Placeholder for the face capture page
import LoginPage from './pages/LoginPage'; // Placeholder for the login page
import CustomNavbar from './components/Navbar'; // Import the navbar

function App() {
  return (
    <Router>
      <CustomNavbar />
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/face-capture" element={<FaceCapturePage />} />
        <Route path="/login" element={<LoginPage />} />
      </Routes>
    </Router>
  );
}

export default App;
